            <div>
                <Profile  profilePic="https://www.trickscity.com/wp-content/uploads/2017/09/cute-profile-pics-for-whatsapp-images.png" profileName="xXxPandaGirlxXx" timeStamp="1 day ago"/>
                <Profile />
                <Profile />
            </div>
        </div>
      )
    }
}


export default Stories;
